package com.manager.support.entity;

public class PPPoEDetails {
	String id;
	String customerId;
	String customerName;
	String pppoeId;
	String pppoePassword;
	
	public PPPoEDetails() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	public String getCustomerId() {
		return customerId;
	}
	public void setCustomerId(String customerId) {
		this.customerId = customerId;
	}
	public String getCustomerName() {
		return customerName;
	}
	public void setCustomerName(String customerName) {
		this.customerName = customerName;
	}
	public String getPppoeId() {
		return pppoeId;
	}
	public void setPppoeId(String pppoeId) {
		this.pppoeId = pppoeId;
	}
	public String getPppoePassword() {
		return pppoePassword;
	}
	public void setPppoePassword(String pppoePassword) {
		this.pppoePassword = pppoePassword;
	}
	
}
